NgxLinkifyjsModule -->\n\nNgxLinkifyjsPipe->NgxLinkifyjsModule\n\n\n\n\n\nNgxLinkifyjsPipe \n\nNgxLinkifyjsPipe \n\nNgxLinkifyjsPipe  -->\n\nNgxLinkifyjsModule->NgxLinkifyjsPipe \n\n\n\n\n\n\n          \n          \n          \n              Zoom in\n              Reset\n              Zoom out\n          \n      \n      \n      \n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n\n        \n            File\n        \n        \n            src/module/ngx-linkifyjs.module.ts\n        \n\n\n        \n\n        \n            \n                \n                    Declarations\n                    \n                            \n                                NgxLinkifyjsPipe\n                            \n                    \n                \n                \n                    Exports\n                    \n                            \n                                    NgxLinkifyjsPipe\n                            \n                    \n                \n            \n        \n    \n\n\n    \n        import {CommonModule} from '@angular/common';\nimport {Inject, InjectionToken, ModuleWithProviders, NgModule} from '@angular/core';\n// @ts-ignore\nimport * as linkify from 'linkifyjs';\n// @ts-ignore\nimport hashtag from 'linkifyjs/plugins/hashtag';\n// @ts-ignore\nimport mention from 'linkifyjs/plugins/mention';\n\nimport {NgxLinkifyjsService} from './service/ngx-linkifyjs.service';\nimport {NgxLinkifyjsPipe} from './pipes/ngx-linkifyjs.pipe';\n\n// Export module's public API\nexport {Link} from './interfaces/ngx-linkifyjs.interface';\nimport {NgxLinkifyjsConfig} from './interfaces/ngx-linkifyjs.interface';\n\nexport {LinkType} from './enum/linktype.enum';\nexport {NgxLinkifyjsPipe} from './pipes/ngx-linkifyjs.pipe';\nexport {NgxLinkifyjsService} from './service/ngx-linkifyjs.service';\n\nexport const NgxLinkifyjsConfigToken = new InjectionToken('NgxLinkifyjsConfig');\nexport const DEFAULT_CONFIG: NgxLinkifyjsConfig = {enableHash: true, enableMention: true};\n\n@NgModule({\n  imports: [\n    CommonModule\n  ],\n  exports: [NgxLinkifyjsPipe],\n  declarations: [NgxLinkifyjsPipe]\n})\nexport class NgxLinkifyjsModule {\n\n  static forRoot(config: NgxLinkifyjsConfig = DEFAULT_CONFIG): ModuleWithProviders {\n    return {\n      ngModule: NgxLinkifyjsModule,\n      providers:\n        [\n          NgxLinkifyjsService,\n          {\n            provide: NgxLinkifyjsConfigToken,\n            useValue: config\n          },\n        ]\n    };\n  }\n\n  constructor(@Inject(NgxLinkifyjsConfigToken)\n              public config: NgxLinkifyjsConfig) {\n    if (config.enableHash) {\n      hashtag(linkify);\n    }\n\n    if (config.enableMention) {\n      mention(linkify);\n    }\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"pipes/NgxLinkifyjsPipe.html":{"url":"pipes/NgxLinkifyjsPipe.html","title":"pipe - NgxLinkifyjsPipe","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n  Pipes\n  NgxLinkifyjsPipe\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n\n        \n            File\n        \n        \n            src/module/pipes/ngx-linkifyjs.pipe.ts\n        \n\n\n\n        \n            Metadata\n            \n                \n                    \n                        Name\n                        linkify\n                    \n                \n            \n        \n\n            \n    \n        \n            Methods\n        \n        \n            \n                \n                    \n                        \n                        \n                            \n                            transform\n                            \n                            \n                        \n                    \n                \n                \n                    \ntransform(value: any, args?: any)\n  